DROP TABLE IF EXISTS `sq_questions`;
CREATE TABLE `sq_questions` (
  `id` int NOT NULL AUTO_INCREMENT COMMENT '问题 id',
  `qu_title` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '问题描述',
  `qu_note` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '问题备注',
  `qu_tag` int DEFAULT NULL COMMENT '问题标签 1=主诉, 2=现病史, 3=既往史, 4=体格检查, 5=辅助检查, 6=辅助检查结果, 7=初步诊断, 8=治疗意见',
